Hatsu infers object id from item.url and item.id. It will use the item.url first, and if it doesn't exist, it will try to convert the item.id to an absolute url. https://example.com/foo/bar => https://example.com/foo/bar
/foo/bar => https://example.com/foo/bar foo/bar => https://example.com/foo/bar Ideally, your item.id and item.url should be consistent absolute links: { "id": "https://example.com/foo/bar", "url": "https://example.com/foo/bar", "title": "...", "content_html": "...", "date_published": "..."
}

