It's not published to npm, so feel free to copy and paste it if you need to use it in a Node.js. Replace hatsu.local with your Hatsu instance. import { Hono } from 'hono'
import { hatsuWellKnown, hatsuObject } from 'aoba/hono/middlewares/hatsu.ts' const app = new Hono()
const instance = new URL('https://hatsu.local') // https://example.com/.well-known/* => https://hatsu.local/.well-known/*
app.use('/.well-known/*'， hatsuWellKnown({ instance }))
// https://example.com/posts/foo => https://hatsu.local/o/https://example.com/posts/foo
app.use('/posts/*', hatsuObject({ instance }))

