Hatsu mimics Pleroma's URL format. @oom/mastodon-components will extract the ID from the URL and query the corresponding API for the data. // oom-comments src
const src = 'https://hatsu.local/notice/aHR0cHM6Ly9leGFtcGxlLmNvbS9mb28vYmFy'
// origin: 'https://hatsu.local
// pathname: '/notice/aHR0cHM6Ly9leGFtcGxlLmNvbS9mb28vYmFy'
const { origin, pathname } = new URL(src)
// id: 'aHR0cHM6Ly9leGFtcGxlLmNvbS9mb28vYmFy'
const [, id] = pathname.match(/^\/notice\/([^\/?#]+)/)
// api url: https://hatsu.local/api/v1/statuses/aHR0cHM6Ly9leGFtcGxlLmNvbS9mb28vYmFy/context
const url = new URL(`/api/v1/statuses/${id}/context`, origin) Upon receiving a request, Hatsu's corresponding API will attempt to decode the base64url ID and return the data. If you're interested in the code, you can also take a look at routes/statuses/status_context.rs and entities/context.rs .
